import React, { useState } from 'react';
import axios from 'axios';
import './LoanForm.css';  // Import the CSS file

const LoanForm = () => {
  const [formData, setFormData] = useState({
    Full_Name: '',
    Address: '',
    PAN_Number: '',
    Company_Name: '',
    Current_Salary: '',
    Previous_Salary: '',
    Owns_House: '',
    Rent_Amount: '',
    Grocery_Expense: '',
    Current_EMIs: '',
    Date_Previous_Hike: '',
    Date_Next_Hike: '',
    Bank_Name: '',
    Credit_Score: '',
    Number_of_Credit_Cards: '',
    Total_Credit_Limit: '',
    Number_of_Loans: '',
    Employment_Duration: '',
    Job_Title: '',
    Bonuses_Allowances: '',
    Savings: '',
    Investments: '',
    Monthly_Expenses: '',
    Age: '',
    Education_Level: '',
    Marital_Status: '',
    Dependents: '',
    Loan_Purpose: '',
    Mall_Visits_Per_Month: '',
    Mall_Spend_Average: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:5000/predict', formData);
      console.log('Prediction Results:', response.data);
      // Handle the response as needed
    } catch (error) {
      console.error('Error making prediction:', error.response ? error.response.data : error.message);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Personal Information</h2>
      <div className="section">
        <div className="card">
          <label>
            Full Name:
            <input type="text" name="Full_Name" value={formData.Full_Name} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Address:
            <input type="text" name="Address" value={formData.Address} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            PAN Number:
            <input type="text" name="PAN_Number" value={formData.PAN_Number} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Company Name:
            <input type="text" name="Company_Name" value={formData.Company_Name} onChange={handleChange} />
          </label>
        </div>
      </div>

      <h2>Financial Information</h2>
      <div className="section">
        <div className="card">
          <label>
            Current Salary:
            <input type="number" name="Current_Salary" value={formData.Current_Salary} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Previous Salary:
            <input type="number" name="Previous_Salary" value={formData.Previous_Salary} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Owns House:
            <select name="Owns_House" value={formData.Owns_House} onChange={handleChange}>
              <option value="">Select</option>
              <option value="Yes">Yes</option>
              <option value="No">No</option>
            </select>
          </label>
        </div>
        <div className="card">
          <label>
            Rent Amount:
            <input type="number" name="Rent_Amount" value={formData.Rent_Amount} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Grocery Expense:
            <input type="number" name="Grocery_Expense" value={formData.Grocery_Expense} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Current EMIs:
            <input type="number" name="Current_EMIs" value={formData.Current_EMIs} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Date of Previous Hike:
            <input type="date" name="Date_Previous_Hike" value={formData.Date_Previous_Hike} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Date of Next Hike:
            <input type="date" name="Date_Next_Hike" value={formData.Date_Next_Hike} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Bank Name:
            <input type="text" name="Bank_Name" value={formData.Bank_Name} onChange={handleChange} />
          </label>
        </div>
      </div>

      <h2>Credit Information</h2>
      <div className="section">
        <div className="card">
          <label>
            Credit Score:
            <input type="number" name="Credit_Score" value={formData.Credit_Score} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Number of Credit Cards:
            <input type="number" name="Number_of_Credit_Cards" value={formData.Number_of_Credit_Cards} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Total Credit Limit:
            <input type="number" name="Total_Credit_Limit" value={formData.Total_Credit_Limit} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Number of Loans:
            <input type="number" name="Number_of_Loans" value={formData.Number_of_Loans} onChange={handleChange} />
          </label>
        </div>
      </div>

      <h2>Employment Information</h2>
      <div className="section">
        <div className="card">
          <label>
            Employment Duration:
            <select name="Employment_Duration" value={formData.Employment_Duration} onChange={handleChange}>
              <option value="">Select</option>
              <option value="Less than 1 year">Less than 1 year</option>
              <option value="1-3 years">1-3 years</option>
              <option value="3-5 years">3-5 years</option>
              <option value="More than 5 years">More than 5 years</option>
            </select>
          </label>
        </div>
        <div className="card">
          <label>
            Job Title:
            <input type="text" name="Job_Title" value={formData.Job_Title} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Bonuses/Allowances:
            <input type="number" name="Bonuses_Allowances" value={formData.Bonuses_Allowances} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Savings:
            <input type="number" name="Savings" value={formData.Savings} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Investments:
            <input type="number" name="Investments" value={formData.Investments} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Monthly Expenses:
            <input type="number" name="Monthly_Expenses" value={formData.Monthly_Expenses} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Age:
            <input type="number" name="Age" value={formData.Age} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Education Level:
            <select name="Education_Level" value={formData.Education_Level} onChange={handleChange}>
              <option value="">Select</option>
              <option value="Graduate">Graduate</option>
              <option value="Postgraduate">Postgraduate</option>
              <option value="PhD">PhD</option>
            </select>
          </label>
        </div>
      </div>

      <h2>Additional Information</h2>
      <div className="section">
        <div className="card">
          <label>
            Marital Status:
            <select name="Marital_Status" value={formData.Marital_Status} onChange={handleChange}>
              <option value="">Select</option>
              <option value="Single">Single</option>
              <option value="Married">Married</option>
            </select>
          </label>
        </div>
        <div className="card">
          <label>
            Dependents:
            <input type="number" name="Dependents" value={formData.Dependents} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Loan Purpose:
            <input type="text" name="Loan_Purpose" value={formData.Loan_Purpose} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Mall Visits Per Month:
            <input type="number" name="Mall_Visits_Per_Month" value={formData.Mall_Visits_Per_Month} onChange={handleChange} />
          </label>
        </div>
        <div className="card">
          <label>
            Mall Spend Average:
            <input type="number" name="Mall_Spend_Average" value={formData.Mall_Spend_Average} onChange={handleChange} />
          </label>
        </div>
      </div>

      <button type="submit">Predict</button>
    </form>
  );
};

export default LoanForm;




